import React, { Component } from "react";
import "./style.css";

class Form extends Component {

  render() {
    return (
      <div className="container">
        <div className="jumbotron">
          <p>Clicky Game</p>
        </div>
        <h1>Hello World!</h1>
        <div id="photoBox">
          <div id="box1" className="boxes"></div>

        </div>
      </div>
    )
  }   
};

export default Form;
